;; Heatmap

(defn log [x] (Math/log x))

(defn heatmap [{:keys [title]} data]
    (gg4clj/view [[:<- :dat (gg4clj/data-frame data)]
                (gg4clj/r+ 
                  [:ggplot :dat [:aes :x :y]]
                  [:ggtitle title]
                  [:geom_tile [:aes {:fill :v}] {:color "white"}]
                  [:scale_fill_gradient {:low "white" :high "steelblue"}]
                  [:theme {:axis.text.x [:element_text {:angle 330}]}])]))

(defn densify [data]
  (when (seq data)
    (let [[xs ys] (apply map vector (keys data))
        xs (sort (distinct xs))
        ys (sort (distinct ys))]
    (->> (for [x xs y ys] (vector x y))
         (reduce (fn [coll [x y]]
                   (assoc coll [x y] (get data [x y] 0)))
                 {})))))

(defn densifyMatrix [data]
  (when (seq data)
    (let [[xs ys] (apply map vector (keys data))
        xs (sort (distinct xs))
        ys (sort (distinct ys))
          mat (->> (for [x xs y ys] (vector x y))
         (map (fn [[x y]]
                   (get data [x y] "NA"))))]
    (format "matrix(c(%s),nrow = %s, ncol = %s)", (str/join ", " mat) (count ys) (count xs)))))

(defn densifyMatrixAY [data]
  (when (seq data)
    (let [[xs ys] (apply map vector (keys data))
        xs (sort (distinct xs))
        ys (range -5 20)
          mat (->> (for [x xs y ys] (vector x y))
         (map (fn [[x y]]
                   (get data [x y] "NA"))))]
    (format "matrix(c(%s),nrow = %s, ncol = %s)", (str/join ", " mat) (count ys) (count xs)))))

(defn densify3 [data]
  (when (seq data)
    (let [[xs ys zs] (apply map vector (keys data))
        xs (sort (distinct xs))
        ys (sort (distinct ys))
        zs (sort (distinct zs))]
    (->> (for [x xs y ys z zs] (vector x y z))
         (reduce (fn [coll [x y z]]
                   (assoc coll [x y z] (get data [x y z] 0)))
                 {})))))

