(defn smooth [data]
  (let [xs (reduce (fn [coll [x _ v]]
                     	(update coll x u/some+ v))
                   {} data)
        ys (reduce (fn [coll [_ y v]]
                     	(update coll y u/some+ v))
                   {} data)
        total (->> (map last data) (reduce +))]
    (map (fn [[x y v]]
           (vector x y (double (/ (* (get xs x) (get ys y)) total)))) data)))

