;; @@
;; Figure out why CL drops and SEMH increases so much

(defn area-plot
  [title df]
  (gg4clj/view [[:<- :foo (gg4clj/data-frame df)]
                (gg4clj/r+ 
                  [:ggplot :foo [:aes {:x :ncy :y :v :fill [:factor :type]}]]
                  [:facet_grid (keyword "year ~ .") {:scales "free"}]
                  [:ggtitle title]
                  [:theme {:axis.text.y [:element_blank]}]
                  [:geom_bar {:stat "identity"}]
                  )]))

(def transitions
  (reduce (fn [coll [[cy ay s1 s2] v]]
          (let [[n1 _] (s/need-setting s1)
                [n2 _] (s/need-setting s2)]
            (cond-> coll
                    (seq (clojure.set/intersection #{:SEMH :CL} (into #{} [n1 n2])))
                    (update [cy ay n1 n2] u/some+ v))))
        {}
        (get-model-transitions)))

(defn to-table
  [transitions]
  (map (fn [[[cy ay n1 n2] v]]
         (let [type (cond (= n1 n2) "remainers"
                          (= n1 :NON-SEND) "joiners"
                          (= n2 :NON-SEND) "leavers")
               need (if (= n1 :NON-SEND) n2 n1)]
           {:year (inc cy) :ncy ay :type type :need (name need) :v v}))
       transitions))

(->> (to-table transitions)
     (filter #(= (:need %) "SEMH"))
     (filter #(<= (:year %) 2021))
     (seq-of-maps->data-frame)
     (area-plot "SEMH population progression"))

(->> (to-table transitions)
     (filter #(= (:need %) "CL"))
     (filter #(<= (:year %) 2021))
     (seq-of-maps->data-frame)
     (area-plot "CL population progression"))
